lyrics:
1
Rongtala, rongtala, Isol b’laksranggipa! 
Pringo ching’ mitelan ring·a, Nang·ona sokchong; 
Rongtala, rongtala! ka·saa b’laksranggipa! 
Saksano Gittam patia nangrima.

2
Rongtala, rongtala! kakketrang tubama; 
Sonan’ mukut’ okgale grikan’ chi duultoke; 
Kiruprang, seraprang, Nang·na sko choknoka; 
Dongchenga, donga, aro dongkamgen..

3
Rongtala, rongtala! Andala dongpenga; 
Papi mande mikronchi Nang·ko nikjaoba; 
Na·asan rongtala, darang gipinde gri, 
Chu·gimik bilan ka·saao simtek’ gri.

4
Rongtala, rongtala, Gitel Isol b’laka; 
Sagal, a·sak, salgi p’lak Nang’ kamko mitelgen; 
Rongtala, rongtala! ka·saa b’laksranggipa,
Saksano Gittam patia nangrima!

1
Bi·ani sal, nitoa sal, 
Neng·takata angko un’ sal;
Un’ sepangona rimange, 
Am·ako on·na agane;
Duk, saknaa, jajrengarango, 
Ka·dimea anga nang·o;
Joka ruran’ ja·gaoni, 
Sokpilon “Bi·an’ sal” nang·ni.

2
Bi·ani sal, nitoa sal,
Ra·angbo ang’ bi·a da·al;
Kakketgipa ang’ Gitelna, 
Patigipa am·gipana;
Ge·eta An·tangko am·na, 
Ka·donge bebera·china;
Galgen jajrengarang’ Unan, 
Senggen “Bi·ani sal” nang·nan.

3
O, namgipa sal “Bi·ani”,
On·pabo ka·dimeani;
Pisgah a·chuo niwate, 
Re·kujana nang·ko wate;
Gale be·enni gandingko,
Ra·e jringjrot ang’ man·gniko;
Inwatangna nang·na un’ sal, 
Re·naha “Nama Bi·an’ Sal.”

1
Suuri ‘bri a·chujol, 
Sagal chichangoni;
Joka an·cheng sarijol, 
Africa chiringoni;
Chibiman’ an·chengoni, 
Kejur a·kaweoni;
Okama ching’ p’lakoni, 
Jokatna paponi.

2
Balmrikoba simila, 
Ceylonni chichang;
Katchani ba mandena, 
Ka·donggramanio;
Indinsajok on·arang, 
Isolni ka·sae;
Olakia bol, wa·rang’, 
Uamang u·ijae.

3
Seng·atgimin an·chinga, 
Gisikchi ‘sakoni;
Jegenma parakatna, 
Tochriko janggini?
Jokata, O, jokata ! 
Katchae aganprakbo;
Messaiani bimungko, 
Jatantin gipatbo.

4
Un’ kattako balpakbo, 
Balwa chipakore;
Rasongni sagal ong·e, 
A·gimik gipate;
Dakgipa, Piokgipa, 
Papna sigipani;
Raja ong·jana kingking, 
Salgio an·chingni.

1
O sal neng·tak, katcha·ani,
O sal ka·srokbean’;
Duk simbrarang gimaani,
Nambat’, ching·bat na·an;
Nokma, nokkol ring·baaha,
Singhason mikkango;
‘Ne rongtala, rongtala,
Jringjrotni Isolna.

2
Na·an duulgimin killa,
Ta·rak balmikkaoni;
Chi rudapgimin bari,
Janggini chiringchi;
Janggin ran·gipa a·ko,
Ka·sinatgipa chi;
Nang·oni Pisgao gita,
Nikatna ua songchi.

3
Nama teng·suchakan sal,
Na·an ka·saani sal;
Aoniko salgisakna,
Ka·saako chimongna;
Gitel ka·saako man·na,
Ia neng·takan’ salni;
Ching’ man·a neng·takani,
Biapo salgini.

1
Gualnabe Sabbathko,
Isolni patiako;
Antini p’lak salrangna,
Nambat ching·batako;
Ra·baa kamni neng·taka,
Katcha·ako agana;
Namgipa salgin’ seng·a,
Teng·dape dilenga.

(Ring·taitaiani)
Katcha·a pangnan rimchaksona,
Neng·takan’ salko;
Katcha·a pangnan rimchaksona,
Neng·takan’ salko.

2
Rakibo rongtale, Uko olakie;
Sninggiparangna ina,
Angan janggin’ rama;
An·ching tom·tom ja·rikon,
Gitelko ianon;
Uan on·gen Janggiko,
Jringjrotni chimikko.

3
Rongtalbegipa sal,
Neng·takgen an·ching da·al;
Mitelan’ git Jisuna,
Bi·sarang ripengna;
O ka·sae Jokatgipa,
Mairong nama Na·a;
Gamchata Nang’ ku·chaka,
Ka·tongo donkamna.

1
